function MyChildCard(){


    return(
        <div className="container">
             <label for="userName">User Name:</label>
                <input type="text" placeholder="User Name" id="userName" name="userNameInp" ></input><br></br>
            MyChildCard
        </div>
    )
}
export default MyChildCard;
